import React, { Component } from 'react';
// import ReactDOM from 'react-dom';
import InputRange from 'react-input-range';
import {Link} from "react-router-dom";

import 'react-input-range/lib/css/index.css'



export default class PriceRange extends Component {
    constructor(props) {
        super(props);

        this.state = {
          value4: {
            min: 0,
            max: 400000,
          },
        };
      }

      render() {
        return (

          // <form className="form danger">
          <Link value={this.state.value4} to={`/shop?minPrice=${value4}&maxPrice=${value4}`}>
            <InputRange             
              maxValue={400000}
              minValue={0}
              formatLabel={value => `${value} vnd`}
              value={this.state.value4}
              onChange={value => this.setState({ value4: value })}

              //href={`/shop?minPrice=${value}&maxPrice=${value}`}
              onChangeComplete={value =>
                console.log(value)
              }
            />
            </Link>
          // </form>
        );
      }
    }

